import { useNavigate } from "react-router-dom";

function Contact(){
    let navigate=useNavigate()
    const change=()=>{
        navigate("/About")
    }
    return (
        <div>
            <h1>Contact page</h1>
            <button onClick={change}>Click back</button>
        </div>
    )
}
export default Contact;
